效果。', 'Transforma al druida en forma de árbol eliminado los efectos físicos nocivos y protege de todos los ataques físicos durante $d, pero no permite atacar, moverse ni lanzar hechizos. Protege al taumaturgo de los efectos poliformos.\r\n\r\nMetamorfosis libera al taumaturgo de los efectos de raíces, cepos y congelación.', '', 4128894, 'Immune to all physical attacks and polymorph effects.  Cannot attack, move or cast spells.', '모든 물리 공격 및 주문에 면역\r\n공격, 이동, 주문 사용 불가', 'Insensible à toutes les attaques physiques et aux effets de métamorphose. Ne peut ni attaquer, ni se déplacer, ni lancer de sorts.', 'Immun gegen jeglichen körperlichen Schaden und Verwandlungseffekte. Kann sich nicht bewegen, angreifen oder Zauber wirken.', '免疫物理攻击和变形效果，不能攻击、移动或施法。', '免疫物理攻擊和變形效果，不能攻擊、移動或施法。', 'Inmune a todos los ataques físicos y efectos polimorfos. No puede atacar, moverse ni lanzar hechizos.', '', 4128894, 20, 133, 1500, 0, 0, 7, 33554432, 0, 1, 1, 4, 1, 1, 1, 0, 0, 0, 0),
