0;F1% de curación del objetivo anterior. Cura a un máximo de $x1 objetivos.', '', 4128894, '', '', '', '', '', '', '', '', 4128892, 0, 133, 1500, 0, 0, 11, 256, 0, 1, 1, -1, 0.5, 1, 1, 0, 0, 0, 0),
