攻擊強度來提升。根據連擊點數決定持續時間：\r\n   1點：8秒內造成40點傷害\r\n   2點：10秒內造成60點傷害\r\n   3點：12秒內造成84點傷害\r\n   4點：14秒內造成112點傷害\r\n   5點：16秒內造成144點傷害', 'Golpe de remate que causa daño durante cierto tiempo, aumentando tu poder de ataque. El daño aumenta con cada punto de combo:\r\n 1 punto  : 40 p. de daño durante 8 s\r\n   2 puntos: 60 p. de daño durante 10 s\r\n   3 puntos: 84 p. de daño durante 12 s\r\n   4 puntos: 112 p. de daño durante 14 s\r\n   5 puntos: 144 p. de daño durante 16 s', '', 4128894, '$s1 damage every $t1 seconds.', '매 $t1초마다 $s1의 피해', '$s1 points de dégâts toutes les $t1 secondes.', 'Alle $t1 Sekunden $s1 Punkte Schaden.', '每$t1秒$s1点伤害。', '每$t1秒$s1點傷害。', '$s1 p. de daño cada $t1 segundos.', '', 4128894, 0, 133, 1000, 0, 0, 8, 1048576, 0, 2, 2, -1, 1, 1, 1, 0, 0, 0, 128),
